const ProductTemplate = ({ product }) => {
return (
    <div className="absolute top-[144px] left-[126px] w-[1202px] h-[863px]">
    {/* Other content */}
    <img
        className="absolute top-[48.93px] left-[136.69px] w-[289.67px] h-[321.48px] object-cover"
        alt=""
        src={product.imageSrc}
    />
    <b className="absolute top-[54px] left-[600px] text-7xl inline-block w-[454px] h-5">
        {product.title}
    </b>
    {/* More content */}
    </div>
);
};

export default ProductTemplate;
